oxy_webhelp_navlinks = {"hyperv_protection_consequences-d23139e19190":{"topics":[{"title":"Protection for new Hyper-V virtual machines","shortdesc":"<p class=\"shortdesc\">A new virtual machine is one for which there are no policy-driven snapshots. After a         new virtual machine is assigned to an SLA Domain, all of its snapshots, replicas and         archival snapshots are created and managed based on the SLA rules of the SLA         Domain.<\/p>","href":"saas\/hyper_v\/hyperv_new_vm_protection.html","attributes":{"data-id":"hyperv_new_vm_protection"},"menu":{"hasChildren":false},"tocID":"hyperv_new_vm_protection-d23139e19201","topics":[]},{"title":"Assigned SLA Domain changes","shortdesc":"<p class=\"shortdesc\">A protected virtual machine may be assigned to another SLA Domain in order to satisfy         specific business requirements (for example, data governance policy changes or space         management requirements).<\/p>","href":"saas\/hyper_v\/assigned_sla_domain_changes.html","attributes":{"data-id":"assigned_sla_domain_changes"},"menu":{"hasChildren":false},"tocID":"assigned_sla_domain_changes-d23139e19212","topics":[]},{"title":"Reprotection of a virtual machine","shortdesc":"<p class=\"shortdesc\">At times, a virtual machine that is protected by one SLA Domain might be temporarily         set to Don't protect and then reassigned to another SLA Domain for protection.<\/p>","href":"saas\/hyper_v\/reprotection_vm.html","attributes":{"data-id":"reprotection_vm"},"menu":{"hasChildren":false},"tocID":"reprotection_vm-d23139e19223","topics":[]},{"title":"Find protected objects","shortdesc":"<p class=\"shortdesc\">You can use several methods for finding protected objects.<\/p>","href":"saas\/hyper_v\/hyperv_find_protected_objects.html","attributes":{"data-id":"hyperv_find_protected_objects"},"menu":{"hasChildren":false},"tocID":"hyperv_find_protected_objects-d23139e19234","topics":[]}]}};